import React from 'react';

function OpenNote() {
  return (
    <div className="component">
      <div id="opennote">
        <h1>references + open notes</h1>
        <h2>references. recordings. mixes. links. writings. etc. </h2>
        <div>
          <p><a href="https://www.lecinemaclub.com/" target="_blank" rel="noreferrer"><b>Le Cinema Club</b><br/>Now Showing</a></p>
        </div>
      </div>
    </div>
  )
}

export default OpenNote;
